  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0112926 includes discrete
  sample, profile and time series profile data collected from HERMANO GINES in the
  Caribbean Sea from 1995-11-08 to 2015-07-29. These data include AMMONIUM (NH4),
  DISSOLVED INORGANIC CARBON (DIC), DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, Dissolved
  Organic Nitrogen, NITRATE, NITRITE, PARTICULATE ORGANIC CARBON, PARTICULATE ORGANIC
  NITROGEN (PON), PHOSPHORUS - ORGANIC, Partial pressure (or fugacity) of carbon dioxide
  - water, SALINITY, SIGMA-THETA, TOTAL ALKALINITY (TA), Total Organic Carbon (TOC),
  WATER TEMPERATURE, nitrate + nitrite content (concentration), pH, phosphate and
  silicate. The instruments used to collect these data include Alkalinity titrator,
  CTD, bottle and spectrophotometer.nnThese data were collected by Yrene M. Astor
  of Estacion de Investigaciones Marinas de Margarita and Frank E. Muller-Karger and
  Laura Lorenzoni of University of South Florida as part of the CARIACO_TS data set.
  CDIAC associated the following cruise ID(s) with this data set: CARIACO Time-SeriesnnThe
  Global CO2 Time-series and Moorings Project involves international groups from 18
  countries who have mounted sensors on moored buoys to provide high resolution time-series
  measurements of atmospheric boundary layer and surface ocean CO2 partial pressure
  (pCO2). The CO2 Time-series and Moorings Project is coordinated by UNESCO International
  Ocean Carbon Coordination Project (IOCCP).\",\n\t\"license_title\": null,\n\t\"extras\":
